// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Home';
import Chatbot from './Chatbot';
import CreateSource from './CreateSource';
import SourceList from './ListSources';
import UploadDocument from './UploadDocument';
import './App.css';
import AutoUploadManager from './AutoUploadManager';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/:mysource" element={<Chatbot />} />
          <Route path="/create-source" element={<CreateSource />} />
          <Route path="/sources" element={<SourceList />} />
          <Route path="/auto-upload" component={AutoUploadManager} />
          <Route path="/sources/:source/upload" element={<UploadDocument />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
